import React from "react";
import Header from "../components/Header";
import Navigation from "../components/Navigation";

export default class OnEveryPage extends React.Component {
  render() {
    return (
      <div className="container">
        <div className="row"></div> <Navigation />
        <Header />
        <div>
          <br />
          <br />{" "}
        </div>
      </div>
    );
  }
}

function SocialMedia() {
  return (
    <div>
      <li className=" justify-content-end nav-item">
        <a>
          <FontAwesomeIcon
            icon={faFacebook}
            style={{ color: "#4968AD" }}
            size="2x"
          />
        </a>
      </li>
      <li className="nav-item">
        <FontAwesomeIcon
          icon={faLinkedin}
          style={{ color: "#0073B0" }}
          size="2x"
        />
      </li>
      <li className="nav-item">
        <FontAwesomeIcon
          icon={faTwitter}
          style={{ color: "#49A1EB" }}
          size="2x"
        />
      </li>
    </div>
  );
}
